import React, { useState } from 'react';
import { useDropzone } from 'react-dropzone';
import { ProgressBar } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import './CompareForm.css';

const CompareForm = () => {
  const [files, setFiles] = useState([]);
  const [loading, setLoading] = useState(false);
  const [progress, setProgress] = useState(0);
  const [title, setTitle] = useState('Loading...');
  const [textInput, setTextInput] = useState('');
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  const { getRootProps, getInputProps } = useDropzone({
    accept: '.pdf',
    onDrop: acceptedFiles => {
      setLoading(true);
      setFiles(acceptedFiles.map(file => Object.assign(file, {
        preview: URL.createObjectURL(file)
      })));

      // Simulate loading progress
      setProgress(0); // Reset progress to 0
      let progressInterval = setInterval(() => {
        setProgress(prevProgress => {
          if (prevProgress >= 100) {
            clearInterval(progressInterval);
            setLoading(false);
            setTitle('Loading...');
            return 100;
          }
          return prevProgress + 2; // Increase the progress by 2% every 50ms
        });
      }, 50); // Set interval to 50ms

      setTimeout(() => {
        setTitle('Analyzing...');
      }, 3000); // Change title after 3 seconds
    }
  });

  const handleTextInputChange = (e) => {
    setTextInput(e.target.value);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const formData = new FormData();
    formData.append('textInput', textInput);
    formData.append('pdfFile', files[0]);

    try {
      const response = await axios.post('http://localhost:4000/compare', formData, {
        headers: {
          'Content-Type': 'multipart/form-data',
        },
      });
      navigate('/dashboard', { state: { matchPercentage: response.data.matchPercentage } });
      setError(null);
    } catch (err) {
      console.error(err); // Log error for debugging
      setError('An error occurred while comparing texts.');
    }
  };

  const getFileIcon = (fileName) => {
    const extension = fileName.split('.').pop();
    switch (extension) {
      case 'pdf':
        return <i className="fas fa-file-pdf"></i>;
      default:
        return <i className="fas fa-file"></i>;
    }
  };

  const thumbs = files.map(file => (
    <div key={file.name} className="thumb">
      <div className="thumb-inner">
        {getFileIcon(file.name)}
        <p>{file.name}</p>
      </div>
    </div>
  ));

  return (
    <div className="scan-screen">
      <h1>ATS API Frontend</h1>
      <div className="card">
        <div className="input-container">
          <section className="container dropzone-container">
            <div {...getRootProps({ className: 'dropzone' })}>
              <input {...getInputProps()} />
              <p>Drag 'n' drop your PDF here, or click to select files</p>
            </div>
            <aside className="thumbs-container">
              {thumbs}
            </aside>
          </section>
          <textarea
            value={textInput}
            onChange={handleTextInputChange}
            placeholder="Enter text input here"
            className="job-description-input"
          />
        </div>
        {loading && (
          <div className="progress-section">
            <h2>{title}</h2>
            <ProgressBar now={progress} label={`${progress}%`} animated striped variant="info" className="mt-3" />
          </div>
        )}
        {!loading && <button className="scan-button" onClick={handleSubmit}>Compare</button>}
        {error && (
          <div className="error">
            <p>{error}</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default CompareForm;
